import React from 'react';
import logo from ''

const Header = () => {

    return (
        <header className="header">
            <div className="header--logo-container">
                <div className="header--logo-image-container">
                    <img src="./images/logo192.png" alt="logo Jara Amaro psicóloga"></img>
                </div>
                <h1 className="header--logo-title">Jara Amaro psicóloga</h1>
            </div>
            <div className="header--menu">
                <nav>
                    <ul>
                        <li>Consultas</li>
                        <li>Testimonios</li>
                        <li>Contacto</li>
                        <li>Sobre mí</li>
                    </ul>
                </nav>

            </div>
        </header>
    );
};

export default Header;
